import React, { useEffect, useRef } from "react";
import "./Home.css";
import Nav from "../components/Nav.jsx";
import hero_img from "../img/gemenini_hero.png";
import { gsap } from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger";
import Case_img from '../img/leopold-bros-light.png'

gsap.registerPlugin(ScrollTrigger);

gsap.registerPlugin(ScrollTrigger);

const  Home= () => {

const panels = gsap.utils.toArray('.sticky_01');
const createScroll01 = () => {

  let sectionOne = document.querySelector(".section-one");
  ScrollTrigger.create({
      trigger: sectionOne,
      start: "top top",
      end: () => "+=" + sectionOne.offsetHeight,
      onRefresh: self => {
        sectionOne.style.marginBottom = (self.end - self.start) + "px";
      }
    })

  let tl1 = gsap.timeline({
      scrollTrigger: {
        trigger: sectionOne,
        start: 'top top',
        end: () => "+=" + (sectionOne.offsetHeight * 2),
        scrub: 1,
        pin:true,
        pinSpacing:false
      },
    })
    tl1.to("#p1",{
     x:230
   })
      tl1.to("#p2",{
     y:60
   })
  .set({}, {}, tl1.duration() * 2)



  let sectionTwo = document.querySelector(".section-two");
  ScrollTrigger.create({
      trigger: sectionTwo,
      start: "top top",
      end: () => "+=" + sectionTwo.offsetHeight,
      onRefresh: self => {
        sectionTwo.style.marginBottom = (self.end - self.start) + "px";
      }
    })


  let tl2 = gsap.timeline({
      scrollTrigger: {
        trigger: sectionTwo,
        start: 'top top',
        end: () => "+=" + (sectionTwo.offsetHeight * 2),
        scrub: 1,
        pin: true,
        pinSpacing: false
      },
    })

      tl2.to(".section-two__inner",{
     x: "-100%"
   })
  .set({}, {}, tl2.duration() * 2)

};

document.addEventListener('DOMContentLoaded', () => {
  createScroll01();
});

    return ( <>

      <section className='s1_Home'>
      <Nav/>

      <div className='div_hero'>
        <img className='heroimg' src={hero_img} alt='hero_img'/>

        <div className='div_cntnt_hero'>
        <h1>Measure Twice,<br/>Cut once</h1>
        </div>
      </div>

      </section>



      <div className="item_nn item">
      <div className="heder header">
        <h3 className="h_ani1">THE PROOF IS IN THE PUDDING</h3>
        <p className="p_ani1">A stack of stuff weâ€™ve been working on lately.</p>
      </div>
      <div className="body" data-haschild="true">
        <div className="content">
          <div className="horizontal center">
            <div className="cards-container">
              <div className="card center gradient-green scr1" >

                <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>

              </div>

              <div className="card center gradient-green scr2" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

              <div class="card center gradient-green scr3">
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

              <div class="card center gradient-green scr4" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>
              <div class="card center gradient-green scr5" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>
              <div class="card center gradient-green scr6" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

              <div class="card center gradient-green scr7" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

              <div class="card center gradient-green scr8" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

              <div class="card center gradient-green scr8" >
                  <div className="div_hid">
                  <img className="logo_cs" src={Case_img} alt="case_img" />
                  <p className="cs_h">Case study</p>
                </div>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>





















  <div class="section-two sticky_01">
      <div class="section-two__inner">
<div class="emty__card" id="empty_card">card1</div>
        <div class="cards" id="card__1">card1</div>
        <div class="cards" id="card__2">card2</div>
        <div class="cards" id="card__3">card3</div>
        <div class="cards" id="card__4">card4</div>
        <div class="cards" id="card__5">card5</div>
        <div class="cards" id="card__6">card6</div>
        <div class="cards" id="card__7">card7</div>
      </div>
    </div>


      </>
     );
}

export default Home;
